ga9H(){return"Ma\u2019an, Jordan"},
ga9r(){return"Nabataean"},
ga9s(){return"Levant"},
ga9E(){return"A Rose-Red City"},
ga9D(){return"Half as Old as Time"},
ga9C(){return"John William Burgon"},
ga9F(){return"Petra is a brilliant display of man\u2019s artistry in turning barren rock into a majestic wonder."},
ga9G(){return"Edward Dawson"},
ga9t(){return"They were particularly skillful in harvesting rainwater, agriculture and stone carving."},
ga9u(){return"Perhaps a more prominent resemblance to Hellenistic style in Petra comes with its Treasury."},
ga9K(){return"\u201cStunning Stone Monuments of Petra | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga9B(){return"Map showing location of Petra in Ma\u2019an Governorate, Jordan."},
ga9x(){return"The area around Petra has been inhabited from as early as 7000  BCE, and the Nabataeans might have settled in what would become the capital city of their kingdom as early as the 4th century BCE.\nThe trading business gained the Nabataeans considerable revenue and Petra became the focus of their wealth. The Nabataeans were accustomed to living in the barren deserts, unlike their enemies, and were able to repel attacks by taking advantage of the area's mountainous terrain."},
ga9y(){return"Petra flourished in the 1st century CE, when its famous Al-Khazneh structure - believed to be the mausoleum of Nabataean king Aretas IV - was constructed, and its population peaked at an estimated 20,000 inhabitants.\nAccess to the city is through a 3/4 mile-long (1.2 km) gorge called the Siq, which leads directly to the Khazneh."},
ga9v(){return'Famous for its rock-cut architecture and water conduit system, Petra is also called the "Red Rose City" because of the color of the stone from which it is carved.\nAnother thing Petra is known for is its Hellenistic (\u201cGreek\u201d) architecture. These influences can be seen in many of the facades at Petra and are a reflection of the cultures that the Nabataens traded with.'},
ga9w(){return"The facade of the Treasury features a broken pediment with a central tholos (\u201cdome\u201d) inside, and two obelisks appear to form into the rock of Petra at the top. Near the bottom of the Treasury we see twin Greek Gods: Pollux, Castor, and Dioscuri, who protect travelers on their journeys. \nNear the top of the Treasury, two victories are seen standing on each side of a female figure on the tholos. This female figure is believed to be the Isis-Tyche, Isis being the Egyptian Goddess and Tyche being the Greek Goddess of good fortune."},
ga9z(){return"Petra is located in southern Jordan. It is adjacent to the mountain of Jabal Al-Madbah, in a basin surrounded by mountains forming the eastern flank of the Arabah valley running from the Dead Sea to the Gulf of Aqaba."},
ga9A(){return"The area around Petra has been inhabited from as early as 7000 BC, and the Nabataeans might have settled in what would become the capital city of their kingdom as early as the 4th century BC.\nArchaeological work has only discovered evidence of Nabataean presence dating back to the second century BC, by which time Petra had become their capital. The Nabataeans were nomadic Arabs who invested in Petra's proximity to the incense trade routes by establishing it as a major regional trading hub."},
ga9m(){return"First Edomites occupied the area and established a foothold."},
ga9l(){return"Became part of the Roman province Arabia"},
ga9q(){return"After being damaged by earthquakes, habitation of the city all but ceased."},
ga9n(){return"Rediscovered by the Swiss traveler Johann Ludwig Burckhardt."},
ga9o(){return"Excavations led on the site by the British School of Archaeology and the American Center of Oriental Research."},
ga9p(){return"Appeared in the film Indiana Jones and The Last Crusade."},
gaat(){return"Pyramids of Giza"},
gaas(){return"The ancient wonder"},
gaar(){return"Cairo, Egypt"},
